import React from "react";

function Tags(props) {
  return (
    <div className="tags">
      <div className="sidebar">
        <h3>Popular Tags</h3>
        <ul className="taglist">
          {props.tags
            ? props.tags.map((tag) => {
                return (
                  <a href="#" className="tag" onClick={()=>tag}>
                    {tag}
                  </a>
                );
              })
            : ""}
        </ul>
      </div>
    </div>
  );
}

export default Tags;
